import "./App.css";
import Header from "./Components/Header";
import Investment from "./Components/Investment";
import Section from "./UI/Section";

function App() {
  return (
    <div className="App">
      <Header />
      <Section
        title="Our Investments"
        desc="Listed below are businesses in which Ash Creek members are currently involved:"
      >
        <Investment />
      </Section>
    </div>
  );
}

export default App;
